import 'dart:convert';import 'package:shared_preferences/shared_preferences.dart';import '../../../api/api.dart';import '../../../api/endpoints.dart';import 'package:http/http.dart' as http;class EmergencyVisitRepository {  API api = API();  Future<dynamic> addEmergencyVisit(final datas) async {    var client = http.Client();    var orderModel;    final SharedPreferences sharedPreferences = await SharedPreferences.getInstance();    String? token = sharedPreferences.getString("token");    print("[POST]:::${domain+Endpoints.issue}");    print("data::::::::${datas.toString()}");    print("token::::::::${token.toString()}");    try {      var response = await client.post(        Uri.parse(domain+Endpoints.issue),        headers: {          'Authorization': 'Bearer $token',          'Content-Type': 'application/json; charset=utf-8',        },        body: datas      );      print("STATUS CODE::::${response.statusCode}");      if (response.statusCode == 200) {        var jsonMap = jsonDecode(response.body);        print("RESPONSE:::::${response.body}");        orderModel = true;      }    } catch (e) {      print("EERESPOSE ERR :: " + e.toString());      return orderModel;    }    return orderModel;  }}